import React from "react";
import contacts from "./contacts";

function Card(props) {
  return (
    <div>
      <div className="card">
        <div className="top">
          <h2 className="name">{props.name}</h2>
          <img className="circle-img" src={props.img} alt="" srcset="" />
        </div>
        <div className="bottom">
          <p className="info"> {props.info}</p>
        </div>
      </div>
    </div>
  );
}

export default Card;
